import React from 'react'
import xfoto from "../logo/xfoto.jpg"

export const SomeData = [
    {
        title:"Kazak",
        link: "/Kazak",
        icon: <img alt="" style={{height:"100px",width:"100px"}} src={xfoto}></img>
    },
    {
        title:"Saat",
        link: "/Saat"
    },
    {
        title:"Gözlük",
        link: "/Gözlük"
    },
    {
        title:"Tisört",
        link: "/Tisört"
    },
    {
        title:"Pantalon",
        link: "/Pantalon"
    },
    {
        title:"RP",
        link: "/RP"
    },
]
